const EVENTS = [
  {
    id: "e1",
    title: "e1",
  },
  {
    id: "e2",
    title: "e2",
  },
  {
    id: "e3",
    title: "e3",
  },
];

export default function EventsPage() {
  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {EVENTS.map((event) => (
          <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}
